const CarInfo = (props) => {

  console.log(props.loadCarInfo);

  const infoForCar = props.carsInfo.map((cars) => {
    return cars.map((car, pos) => {
      return (
        <li key={pos}>
          <button data-id={car.id}>
            {car.brand} {car.series}
          </button>
        </li>
      );
    });
  });

  return (
    <div className="car-info">
      <ul>
        {infoForCar}
      </ul>
    </div>
  );
};

export default CarInfo;
